import axios from 'axios'
import { useReducer } from 'react'

const API_URL = 'http://localhost:8000/'

class UserService {
    profile(){
        return axios
        .get(API_URL + 'profile/')
        .then(response => {
            return response.data
        })
    }
}


export default UserService
